"use strict";
export function csgVec3ToVector3(src, target) {
  target.x = src[0];
  target.y = src[1];
  target.z = src[2];
}
export function vector3ToCsgVec3(src, target) {
  target[0] = src.x;
  target[1] = src.y;
  target[2] = src.z;
}
export function vector2ToCsgVec2(src, target) {
  target[0] = src.x;
  target[1] = src.y;
}
export function colorToCsgRGB(src, target) {
  target[0] = src.r;
  target[1] = src.g;
  target[2] = src.b;
}
